import React from "react";
import { styled } from "styled-components";

const CryptoWrapper = styled.div`
  padding: 1rem 2rem;
  width: 100%;
  height: 80px;
  display: flex;
  align-items: center;
  img {
    width: 40px;
    height: 40px;
  }
`;
const CryptoNames = styled.div`
  margin-left: 1rem;
  display: flex;
  flex-direction: column;
  div:first-child {
    border-bottom: 1px solid #000;
  }
`;

function Crypto({ fullName, price, ticker, change, logo }) {
  return (
    <CryptoWrapper>
      <img src={logo} alt="" />
      <CryptoNames className="">
        <div>{fullName}</div>
        <div>{ticker}</div>
      </CryptoNames>
      {price} {change} :
    </CryptoWrapper>
  );
}

export default Crypto;
